const godotEventsArray=[];let currentEventIndex=0;class GodotEvent{constructor(name,data){this.name=name,this.data=data}}const newGodotEvent=(name,data)=>{godotEventsArray.push(new GodotEvent(name,data))},hasEvent=()=>currentEventIndex<godotEventsArray.length,popEvent=()=>godotEventsArray[currentEventIndex++],clearEventsArray=()=>{godotEventsArray.splice(0,currentEventIndex),currentEventIndex=0};